class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if len(s) == 0:
            return True
        
        i = 1
        for letter in t:

            if letter != s[i-1]:
                continue

            i += 1
            if i == len(s):
                return True
        
        return False


MySol = Solution()
s1 = "abc"  # True
t1 = "ahbgdc"
s2 = "axc"  # False
t2 = "ahbgdc"
s3 = "aaaaaa"  # False
t3 = "bbaaaa"

s4 = "leeeeetcode"  # True
t4 = ""

s5 = "b"
t5 = "c"

print(MySol.isSubsequence(s5, t5))

assert MySol.isSubsequence(s1, t1 ) == True
assert MySol.isSubsequence(s2, t2 ) == False
assert MySol.isSubsequence(s3, t3 ) == False
assert MySol.isSubsequence(s4, t4 ) == True